// import "./FaceRecongition.css";

const FaceRecongition = ({ imageUrl }) => {
  return (
    <div className="center ma">
      <div className="absolute mt2">
        <img id="image" alt="" src={imageUrl} width="500" height="auto"></img>
      </div>
    </div>
  );
};

export default FaceRecongition;
